import Layout from '../components/Layout';
import Image from 'next/image';
import { projectPage, projectImage, projectText } from '../styles.module.css';

const Projects = () => (
  <Layout>
    <div className={projectPage}>
      <h1>Projects</h1>
      <div className={projectImage}>
        <div>
          <Image
            alt="beHuman Logo"
            src="/beHumanLogo.png"
            layout="intrinsic"
            width={312}
            height={312}
          />
       </div>
        <div>
          <Image
            alt="beHuman Logo"
            src="/beHumanLogo.png"
            layout="intrinsic"
            width={312}
            height={312}
          />
        </div>
        <div>
          <Image
            alt="beHuman Logo"
            src="/AlcheZoom"
            layout="intrinsic"
            width={312}
            height={312}
          />
        </div>
      </div>
    </div>
  </Layout>
  );

  export default Projects;
